<title>404 - Not found</title>
</head>

<body>

<!-- Universal preloader -->

<!-- Universal preloader -->

<div id="wrapper">
<!-- 404 graphic -->
	<div class="graphic">
        <img src="data:image/png;base64," alt="404">
    </div>
<!-- 404 graphic -->

<!-- Text, search form and menu -->
<div class="top-left">
    <!-- Not found text -->
    	<div class="not-found-text">
        	<h1 class="not-found-text">Oh, Page not found</h1>
        </div>
    <!-- Not found text -->

    <!-- search form -->
    <div class="search">
    	<form name="search" method="get" action="tim-kiem">
            <input type="text" name="search" value="Tìm kiếm ...">
            <input class="with-tooltip" type="submit" name="submit" value="" original-title="Tìm kiếm!">
        </form>
    </div>
    <!-- search form -->

    <!-- top menu -->
    <div class="top-menu">
    	<a href=""><h2 style="margin: 0px">Trang chủ</h2></a>
    </div>
    <!-- top menu -->
</div>
<!-- Text, search form and menu -->

<!-- planet at the bottom -->
	<div class="planet">
        <div class="dog-wrapper">
        <!-- dog running -->
            <div class="dog" style="background-position: 0px 0px;"></div>
        <!-- dog running -->
            
        <!-- dog bubble talking -->
            <div class="dog-bubble" style="opacity: 0.225489; bottom: 2.25489px;"><p>
                    Chúng ta đang tìm kiếm gì vậy nhỉ? @_@
                </p></div>
            
            <!-- The dog bubble rotates these -->
            <div class="bubble-options">
                <p class="dog-bubble" style="opacity: 0.225489; bottom: 2.25489px;">
                    Bạn bị lạc sao? Đừng lo lắng, tôi sẽ chỉ đường cho bạn!!!
                </p>
                <p class="dog-bubble" style="opacity: 0.225489; bottom: 2.25489px;">
                    <br>
                    Hey, Hey, follow me.
                </p>
                <p class="dog-bubble" style="opacity: 0.225489; bottom: 2.25489px;">
